import * as React from 'react';
import { NavBarListButton } from '././NavBarListButton'
import './navBarStyles.css';

interface Props {

}

export const NavBarList: React.FC<Props> = () => {
    return ( 
        <div className='navBarList'>
            <NavBarListButton name='Assets' />
            <NavBarListButton name='Trade' />
            <NavBarListButton name='Pay' />
            <NavBarListButton name='For You' />
            <NavBarListButton name='Learn and earn' />
            <NavBarListButton name='Notifications' />
            <NavBarListButton name='Invite Friends' />
        </div>
     );
}
